import { createSlice } from '@reduxjs/toolkit';

export const Foods = createSlice({
  name: 'foods',
  initialState: {
    name: '',
    carbohydrate: 0,
    protein: 0,
    province: 0,
  },
  reducers: {},
});

export const {} = Foods.actions;

export default Foods.reducer;
